<strong>dbus-list-hash-table</strong> is a compiled Lisp function in `<code>dbus.el</code>'.<br/>
<br/>
(dbus-list-hash-table)<br/>
<br/>
Returns all registered member registrations to D-Bus.<br/>
The return value is a list, with elements of kind (KEY . VALUE).<br/>
See `dbus-registered-objects-table' for a description of the<br/>
hash table.
